<!DOCTYPE html>

<html lang="pt-BR">
<head>
<meta charset="utf-8"/>
<meta content="width=device-width, initial-scale=1.0" name="viewport"/>
<title>An√°lise de Vendas - Dashboard Executivo</title>
<style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        body {
            font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;
            background: #F0F5CD;
            color: #00512A;
            padding: 20px;
            min-height: 100vh;
        }

        .container {
            max-width: 1400px;
            margin: 0 auto;
        }

        .header {
            background: #00512A;
            border: 2px solid #007C27;
            border-radius: 20px;
            padding: 30px;
            margin-bottom: 25px;
            text-align: center;
        }

        .header h1 {
            color: white;
            font-size: 2.5em;
            font-weight: 700;
            margin-bottom: 10px;
        }

        .header p {
            color: white;
            font-size: 1.2em;
            font-weight: 500;
        }

        .filters-section {
            background: white;
            border: 2px solid #007C27;
            border-radius: 20px;
            padding: 25px;
            margin-bottom: 25px;
        }

        .filters-grid {
            display: grid;
            grid-template-columns: repeat(auto-fit, minmax(200px, 1fr));
            gap: 20px;
            margin-bottom: 20px;
        }

        .filter-group label {
            display: block;
            font-weight: 600;
            color: #00512A;
            margin-bottom: 8px;
            text-transform: uppercase;
            font-size: 0.9em;
        }

        .filter-group select {
            width: 100%;
            padding: 12px 15px;
            background: #F0F5CD;
            border: 2px solid #007C27;
            border-radius: 8px;
            color: #00512A;
            font-size: 1em;
            font-weight: 500;
        }

        .filter-group select:focus {
            outline: none;
            border-color: #00512A;
            box-shadow: 0 0 5px rgba(0, 124, 39, 0.3);
        }

        .month-filter-container {
            position: relative;
        }

        .month-dropdown-button {
            width: 100%;
            padding: 12px 15px;
            background: #F0F5CD;
            border: 2px solid #007C27;
            border-radius: 8px;
            color: #00512A;
            font-size: 1em;
            font-weight: 500;
            cursor: pointer;
            text-align: left;
            display: flex;
            justify-content: space-between;
            align-items: center;
        }

        .month-dropdown-button:hover {
            background: #E8F3B8;
        }

        .month-dropdown-content {
            display: none;
            position: absolute;
            top: 100%;
            left: 0;
            right: 0;
            background: white;
            border: 2px solid #007C27;
            border-radius: 8px;
            z-index: 1000;
            max-height: 300px;
            overflow-y: auto;
            margin-top: 2px;
        }

        .month-dropdown-content.show {
            display: block;
        }

        .month-checkbox-item {
            padding: 10px 15px;
            display: flex;
            align-items: center;
            cursor: pointer;
            transition: background-color 0.2s;
        }

        .month-checkbox-item:hover {
            background: #F0F5CD;
        }

        .month-checkbox-item input[type="checkbox"] {
            margin-right: 10px;
            cursor: pointer;
        }

        .month-checkbox-item label {
            margin: 0;
            cursor: pointer;
            font-weight: 500;
            text-transform: none;
        }

        .clear-months-btn {
            padding: 8px 15px;
            background: #007C27;
            color: white;
            border: none;
            margin: 10px;
            border-radius: 5px;
            cursor: pointer;
            font-size: 0.9em;
            font-weight: 600;
        }

        .clear-months-btn:hover {
            background: #00512A;
        }

        .clear-filters {
            padding: 12px 25px;
            background: #00512A;
            color: white;
            border: none;
            border-radius: 8px;
            font-weight: 600;
            cursor: pointer;
            text-transform: uppercase;
            transition: all 0.3s ease;
        }

        .clear-filters:hover {
            background: #007C27;
            transform: translateY(-2px);
        }

        .summary-cards {
            display: grid;
            grid-template-columns: repeat(4, 1fr);
            gap: 20px;
            margin-bottom: 30px;
        }

        .summary-card {
            background: white;
            border-radius: 16px;
            padding: 25px;
            text-align: center;
            transition: transform 0.3s ease;
            box-shadow: 0 2px 8px rgba(0, 81, 42, 0.1);
        }

        .summary-card:hover {
            transform: translateY(-5px);
            box-shadow: 0 8px 25px rgba(0, 81, 42, 0.2);
        }

        .summary-card h3 {
            color: #00512A;
            font-size: 1em;
            margin-bottom: 15px;
            text-transform: uppercase;
            font-weight: 600;
        }

        .summary-card .value {
            font-size: 2.2em;
            font-weight: 800;
            color: #007C27;
            margin-bottom: 10px;
        }

        .summary-card .percentage {
            padding: 8px 16px;
            border-radius: 20px;
            font-weight: 700;
            font-size: 1.1em;
            display: inline-block;
        }

        .positive {
            background: rgba(0, 124, 39, 0.15);
            color: #007C27;
        }

        .negative {
            background: rgba(220, 53, 69, 0.15);
            color: #dc3545;
        }

        .neutral {
            background: rgba(255, 193, 7, 0.15);
            color: #e67e22;
        }

        .analysis-section {
            display: grid;
            grid-template-columns: 1fr 1fr;
            gap: 25px;
            margin-bottom: 30px;
        }

        .analysis-card {
            background: white;
            border: 2px solid #007C27;
            border-radius: 20px;
            padding: 25px;
        }

        .analysis-card h2 {
            color: #00512A;
            font-size: 1.5em;
            font-weight: 700;
            margin-bottom: 20px;
            text-align: center;
            text-transform: uppercase;
        }

        .channel-item, .product-item, .trend-item {
            display: flex;
            justify-content: space-between;
            align-items: center;
            padding: 12px 0;
            border-bottom: 1px solid #F0F5CD;
        }

        .channel-item:last-child, .product-item:last-child, .trend-item:last-child {
            border-bottom: none;
        }

        .item-name {
            font-weight: 600;
            color: #00512A;
        }

        .item-value {
            font-weight: 700;
            color: #007C27;
        }

        .projects-section {
            background: white;
            border: 2px solid #007C27;
            border-radius: 20px;
            padding: 25px;
            margin-bottom: 30px;
        }

        .projects-section h2 {
            color: #00512A;
            font-size: 1.8em;
            font-weight: 700;
            margin-bottom: 20px;
            text-align: center;
            text-transform: uppercase;
        }

        .table-section {
            background: white;
            border: 2px solid #007C27;
            border-radius: 20px;
            padding: 25px;
        }

        .table-section h2 {
            color: #00512A;
            font-size: 1.8em;
            font-weight: 700;
            margin-bottom: 20px;
            text-align: center;
            text-transform: uppercase;
        }

        .table-container {
            overflow-x: auto;
        }

        table {
            width: 100%;
            border-collapse: collapse;
            background: white;
        }

        th {
            background: #00512A;
            color: white;
            padding: 15px 10px;
            text-align: left;
            font-weight: 600;
            text-transform: uppercase;
            font-size: 0.9em;
        }

        td {
            padding: 12px 10px;
            border-bottom: 1px solid #F0F5CD;
            color: #00512A;
        }

        tr:nth-child(even) {
            background: #F0F5CD;
        }

        tr:hover {
            background: rgba(0, 124, 39, 0.1);
        }

        .currency {
            text-align: right;
            font-weight: 600;
            color: #007C27;
        }

        .number {
            text-align: center;
            font-weight: 600;
        }

        .percentage-cell {
            text-align: center;
            font-weight: 700;
        }

        @media (max-width: 768px) {
            .filters-grid {
                grid-template-columns: 1fr;
            }
            .summary-cards {
                grid-template-columns: 1fr;
            }
            .analysis-section {
                grid-template-columns: 1fr;
            }
            .header h1 {
                font-size: 2em;
            }
            table {
                font-size: 0.85em;
            }
        }

        @media (min-width: 769px) and (max-width: 1200px) {
            .summary-cards {
                grid-template-columns: repeat(2, 1fr);
            }
        }
    </style>
<style>
/* --- Tabs scaffolding (non-intrusive) --- */
.nav-tabs-wrapper{position:sticky;top:0;z-index:9999;background:#00512A;border-bottom:2px solid #007C27}
.nav-tabs{display:flex;flex-wrap:wrap;gap:0}
.nav-tabs button{appearance:none;border:0;margin:0;padding:14px 18px;background:#00512A;color:#fff;font-weight:700;cursor:pointer;transition:.2s;border-right:1px solid rgba(255,255,255,.12)}
.nav-tabs button:hover{background:#007C27}
.nav-tabs button.active{background:#007C27;box-shadow:inset 0 -3px 0 #F0F5CD}
.tab-pane{display:none}
.tab-pane.active{display:block}
/* iframe area */
.tab-iframe{width:100%;min-height:1200px;border:0;display:block;background:#fff}
@media (max-width:900px){.nav-tabs button{padding:12px 12px;font-size:.95em}}
</style>
<script>
(function(){
  function openTab(id, btn){
    document.querySelectorAll('.tab-pane').forEach(p=>p.classList.remove('active'));
    document.getElementById(id).classList.add('active');
    document.querySelectorAll('.nav-tabs button').forEach(b=>b.classList.remove('active'));
    if(btn) btn.classList.add('active');
    // optional: trigger iframe resize
    const iframe = document.querySelector('#'+id+' iframe');
    if(iframe && iframe.contentWindow){
      try{
        setTimeout(function(){
          const h = Math.max(iframe.contentWindow.document.body.scrollHeight, 1200);
          iframe.style.minHeight = h + 'px';
        }, 300);
      }catch(e){}
    }
  }
  window.__openTab = openTab;
  document.addEventListener('DOMContentLoaded', function(){
    const first = document.querySelector('.nav-tabs button[data-target]');
    if(first){ first.click(); }
  });
})();
</script>

  background: #00512A;
}

        function parseMonetary(value) {
            if (typeof value === 'number') return value;
            if (!value || value === '0,00') return 0;
            return parseFloat(value.toString().replace(/[^\d,-]/g, '').replace(',', '.')) || 0;
        }

        function formatCurrency(value) {
            if (value >= 1000000) {
                return `R$ ${(value / 1000000).toFixed(1)}M`;
            } else if (value >= 1000) {
                return `R$ ${(value / 1000).toFixed(0)}K`;
            } else {
                return new Intl.NumberFormat('pt-BR', {
                    style: 'currency',
                    currency: 'BRL'
                }).format(value);
            }
        }

        function toggleMonthDropdown() {
            const dropdown = document.getElementById('monthDropdown');
            dropdown.classList.toggle('show');
        }

        function setupMonthFilter() {
            const months = [...new Set(salesData.map(row => row['M√™s']).filter(v => v))];
            const monthCheckboxes = document.getElementById('monthCheckboxes');
            
            months.forEach(month => {
                const checkboxItem = document.createElement('div');
                checkboxItem.className = 'month-checkbox-item';
                
                checkboxItem.innerHTML = `
                    <input type="checkbox" id="month_${month}" value="${month}" onchange="updateMonthSelection()">
                    <label for="month_${month}">${month}</label>
                `;
                
                monthCheckboxes.appendChild(checkboxItem);
            });
        }

        function updateMonthSelection() {
            const checkboxes = document.querySelectorAll('#monthCheckboxes input[type="checkbox"]');
            selectedMonths = [];
            
            checkboxes.forEach(checkbox => {
                if (checkbox.checked) {
                    selectedMonths.push(checkbox.value);
                }
            });
            
            updateMonthButtonText();
            applyFilters();
            updateDisplay();
        }

        function updateMonthButtonText() {
            const buttonText = document.getElementById('monthButtonText');
            
            if (selectedMonths.length === 0) {
                buttonText.textContent = 'Todos os meses';
            } else if (selectedMonths.length === 1) {
                buttonText.textContent = selectedMonths[0];
            } else {
                buttonText.textContent = `${selectedMonths.length} meses selecionados`;
            }
        }

        function clearMonthSelection() {
            const checkboxes = document.querySelectorAll('#monthCheckboxes input[type="checkbox"]');
            checkboxes.forEach(checkbox => {
                checkbox.checked = false;
            });
            selectedMonths = [];
            updateMonthButtonText();
            applyFilters();
            updateDisplay();
        }

        function setupFilters() {
            const years = [...new Set(salesData.map(row => row['Ano']).filter(v => v))];
            const channels = [...new Set(salesData.map(row => row['Canal']).filter(v => v))];
            const goalTypes = [...new Set(salesData.map(row => row['Tipo da Meta']).filter(v => v))];
            const productLines = [...new Set(salesData.map(row => row['Linha de Produto']).filter(v => v))];
            const products = [...new Set(salesData.map(row => row['Produto']).filter(v => v))];

            setupMonthFilter();
            populateSelect('filterYear', years);
            populateSelect('filterChannel', channels);
            populateSelect('filterGoalType', goalTypes);
            populateSelect('filterProductLine', productLines);
            populateSelect('filterProduct', products);

            ['filterYear', 'filterChannel', 'filterGoalType', 'filterProductLine', 'filterProduct'].forEach(id => {
                document.getElementById(id).addEventListener('change', () => {
                    applyFilters();
                    updateDisplay();
                });
            });
        }

        function populateSelect(selectId, options) {
            const select = document.getElementById(selectId);
            options.forEach(option => {
                const optionElement = document.createElement('option');
                optionElement.value = option;
                optionElement.textContent = option;
                select.appendChild(optionElement);
            });
        }

        function applyFilters() {
            const filters = {
                months: selectedMonths,
                year: document.getElementById('filterYear').value,
                channel: document.getElementById('filterChannel').value,
                goalType: document.getElementById('filterGoalType').value,
                productLine: document.getElementById('filterProductLine').value,
                product: document.getElementById('filterProduct').value
            };

            filteredData = salesData.filter(row => {
                return (filters.months.length === 0 || filters.months.includes(row['M√™s'])) &&
                       (!filters.year || row['Ano'] === filters.year) &&
                       (!filters.channel || row['Canal'] === filters.channel) &&
                       (!filters.goalType || row['Tipo da Meta'] === filters.goalType) &&
                       (!filters.productLine || row['Linha de Produto'] === filters.productLine) &&
                       (!filters.product || row['Produto'] === filters.product);
            });
        }

            updateSummaryCards();
            updateChannelAnalysis();
            updateTopProducts();
            updateMonthlyTrend();
            updateProjectsSummary();
            updateTable();
        }

        function updateSummaryCards() {
            let totalMetaVGV = 0;
            let totalRealVGV = 0;
            let totalMetaQtd = 0;
            let totalRealQtd = 0;

            // Calcular totais dos dados filtrados
            filteredData.forEach(row => {
                const metaVGV = parseMonetary(row['Meta VGV']);
                const realVGV = parseMonetary(row['Real VGV']);
                totalMetaVGV += metaVGV;
                totalRealVGV += realVGV;
                totalMetaQtd += parseInt(row['Meta Qtd']) || 0;
                totalRealQtd += parseInt(row['Real Qtd']) || 0;
            });

            // Para Share, buscar dados com os mesmos filtros (exceto canal)
            const currentFilters = {
                months: selectedMonths,
                year: document.getElementById('filterYear').value,
                goalType: document.getElementById('filterGoalType').value,
                productLine: document.getElementById('filterProductLine').value,
                product: document.getElementById('filterProduct').value
            };

            let houseRealVGV = 0;
            let imobRealVGV = 0;
            let geralRealVGV = 0;

            // Buscar dados de todos os canais com os mesmos filtros (sem filtro de canal)
            salesData.forEach(row => {
                const matchesFilters = (currentFilters.months.length === 0 || currentFilters.months.includes(row['M√™s'])) &&
                                     (!currentFilters.year || row['Ano'] === currentFilters.year) &&
                                     (!currentFilters.goalType || row['Tipo da Meta'] === currentFilters.goalType) &&
                                     (!currentFilters.productLine || row['Linha de Produto'] === currentFilters.productLine) &&
                                     (!currentFilters.product || row['Produto'] === currentFilters.product);

                if (matchesFilters) {
                    const realVGV = parseMonetary(row['Real VGV']);
                    
                    if (row['Canal'] === 'HOUSE') {
                        houseRealVGV += realVGV;
                    } else if (row['Canal'] === 'IMOB') {
                        imobRealVGV += realVGV;
                    } else if (row['Canal'] === 'GERAL') {
                        geralRealVGV += realVGV;
                    }
                }
            });

            // L√≥gica do Share baseada no filtro de canal
            const currentChannelFilter = document.getElementById('filterChannel').value;
            let houseShare = 0;
            let imobShare = 0;
            let shareLabel = '';
            
            switch(currentChannelFilter) {
                case 'GERAL':
                    // Quando filtrado por GERAL, mostrar share da HOUSE e IMOB vs GERAL
                    if (geralRealVGV > 0) {
                        houseShare = (houseRealVGV / geralRealVGV) * 100;
                        imobShare = (imobRealVGV / geralRealVGV) * 100;
                    }
                    shareLabel = 'vs GERAL';
                    break;
                    
                case 'HOUSE':
                    // Quando filtrado por HOUSE, mostrar 100% para HOUSE e 0% para IMOB
                    houseShare = 100;
                    imobShare = 0;
                    shareLabel = 'Canal Filtrado';
                    break;
                    
                case 'IMOB':
                    // Quando filtrado por IMOB, mostrar 0% para HOUSE e 100% para IMOB
                    houseShare = 0;
                    imobShare = 100;
                    shareLabel = 'Canal Filtrado';
                    break;
                    
                default: // Sem filtro
                    const totalVGV = houseRealVGV + imobRealVGV + geralRealVGV;
                    if (totalVGV > 0) {
                        houseShare = (houseRealVGV / totalVGV) * 100;
                        imobShare = (imobRealVGV / totalVGV) * 100;
                    }
                    shareLabel = 'Participa√ß√£o';
                    break;
            }

            const performanceVGV = totalMetaVGV > 0 ? (totalRealVGV / totalMetaVGV) * 100 : 0;
            const performanceQtd = totalMetaQtd > 0 ? (totalRealQtd / totalMetaQtd) * 100 : 0;
            const gapVGV = totalMetaVGV - totalRealVGV;
            const gapQtd = totalMetaQtd - totalRealQtd;

            document.getElementById('summaryCards').innerHTML = `
                <div class="summary-card">
                    <h3>üí∞ Meta VGV Total</h3>
                    <div class="value">${formatCurrency(totalMetaVGV)}</div>
                </div>
                <div class="summary-card">
                    <h3>‚úÖ Realizado VGV</h3>
                    <div class="value">${formatCurrency(totalRealVGV)}</div>
                    <div class="percentage ${performanceVGV >= 100 ? 'positive' : performanceVGV >= 80 ? 'neutral' : 'negative'}">${performanceVGV.toFixed(1)}%</div>
                </div>
                <div class="summary-card">
                    <h3>üìä Gap VGV</h3>
                    <div class="value">${formatCurrency(Math.abs(gapVGV))}</div>
                    <div class="percentage ${gapVGV <= 0 ? 'positive' : 'negative'}">${gapVGV <= 0 ? 'Meta Atingida!' : 'Falta Atingir'}</div>
                </div>
                <div class="summary-card">
                    <h3>üéØ Meta Quantidade</h3>
                    <div class="value">${totalMetaQtd.toLocaleString()}</div>
                </div>
                <div class="summary-card">
                    <h3>üìà Realizado Qtd</h3>
                    <div class="value">${totalRealQtd.toLocaleString()}</div>
                    <div class="percentage ${performanceQtd >= 100 ? 'positive' : performanceQtd >= 80 ? 'neutral' : 'negative'}">${performanceQtd.toFixed(1)}%</div>
                </div>
                <div class="summary-card">
                    <h3>üìâ Gap Quantidade</h3>
                    <div class="value">${Math.abs(gapQtd).toLocaleString()}</div>
                    <div class="percentage ${gapQtd <= 0 ? 'positive' : 'negative'}">${gapQtd <= 0 ? 'Meta Atingida!' : 'Falta Atingir'}</div>
                </div>
                <div class="summary-card">
                    <h3>üè† Share HOUSE</h3>
                    <div class="value">${houseShare.toFixed(1)}%</div>
                    <div class="percentage neutral">${shareLabel}</div>
                </div>
                <div class="summary-card">
                    <h3>üè¢ Share IMOB</h3>
                    <div class="value">${imobShare.toFixed(1)}%</div>
                    <div class="percentage neutral">${shareLabel}</div>
                </div>
            `;
        }

        function updateChannelAnalysis() {
            const channelData = {};
            
            filteredData.forEach(row => {
                const channel = row['Canal'];
                const metaVGV = parseMonetary(row['Meta VGV']);
                const realVGV = parseMonetary(row['Real VGV']);
                const metaQtd = parseInt(row['Meta Qtd']) || 0;
                const realQtd = parseInt(row['Real Qtd']) || 0;
                
                if (!channelData[channel]) {
                    channelData[channel] = { 
                        metaVGV: 0, 
                        realVGV: 0, 
                        metaQtd: 0, 
                        realQtd: 0 
                    };
                }
                channelData[channel].metaVGV += metaVGV;
                channelData[channel].realVGV += realVGV;
                channelData[channel].metaQtd += metaQtd;
                channelData[channel].realQtd += realQtd;
            });

            const channelHTML = Object.entries(channelData)
                .sort(([,a], [,b]) => b.realVGV - a.realVGV)
                .map(([channel, data]) => {
                    const performanceVGV = data.metaVGV > 0 ? (data.realVGV / data.metaVGV) * 100 : 0;
                    const performanceQtd = data.metaQtd > 0 ? (data.realQtd / data.metaQtd) * 100 : 0;
                    
                    return `
                        <div class="channel-item">
                            <div class="item-name">${channel}</div>
                            <div class="item-value">
                                ${performanceVGV.toFixed(1)}% VGV ‚Ä¢ ${performanceQtd.toFixed(1)}% Qtd
                            </div>
                        </div>
                    `;
                }).join('');

            document.getElementById('channelAnalysis').innerHTML = channelHTML;
        }

        function updateTopProducts() {
            const productData = {};
            
            filteredData.forEach(row => {
                const product = row['Produto'];
                const realVGV = parseMonetary(row['Real VGV']);
                
                if (!productData[product]) {
                    productData[product] = { vgv: 0, count: 0 };
                }
                productData[product].vgv += realVGV;
                productData[product].count += parseInt(row['Real Qtd']) || 0;
            });

            const topProductsHTML = Object.entries(productData)
                .sort(([,a], [,b]) => b.vgv - a.vgv)
                .slice(0, 5)
                .map(([product, data]) => `
                    <div class="product-item">
                        <div class="item-name">${product}</div>
                        <div class="item-value">${formatCurrency(data.vgv)}</div>
                    </div>
                `).join('');

            document.getElementById('topProducts').innerHTML = topProductsHTML;
        }

        function updateMonthlyTrend() {
            const monthData = {};
            const allMonths = [
                'Janeiro', 'Fevereiro', 'Mar√ßo', 'Abril', 'Maio', 'Junho',
                'Julho', 'Agosto', 'Setembro', 'Outubro', 'Novembro', 'Dezembro'
            ];
            
            const years = [...new Set(filteredData.map(row => row['Ano']).filter(v => v))].sort();
            
            years.forEach(year => {
                allMonths.forEach(month => {
                    const monthYear = `${month}/${year}`;
                    monthData[monthYear] = 0;
                });
            });
            
            filteredData.forEach(row => {
                const monthYear = `${row['M√™s']}/${row['Ano']}`;
                const realVGV = parseMonetary(row['Real VGV']);
                
                if (monthData.hasOwnProperty(monthYear)) {
                    monthData[monthYear] += realVGV;
                }
            });

            const sortedMonths = Object.entries(monthData).sort(([a], [b]) => {
                const [monthA, yearA] = a.split('/');
                const [monthB, yearB] = b.split('/');
                
                if (yearA !== yearB) return parseInt(yearA) - parseInt(yearB);
                return allMonths.indexOf(monthA) - allMonths.indexOf(monthB);
            });

            const trendHTML = sortedMonths.map(([month, value]) => `
                <div class="trend-item">
                    <div class="item-name">${month}</div>
                    <div class="item-value">${formatCurrency(value)}</div>
                </div>
            `).join('');

            document.getElementById('monthlyTrend').innerHTML = trendHTML;
        }

        const data = csvData.trim().split('\n').map(row =&gt; row.split(','));
        const headers = data[0];
        const rows = data.slice(1);

        const tableHeader = document.getElementById('tableHeader');
        const tableBody = document.getElementById('tableBody');
        const empreendimentoFilter = document.getElementById('empreendimentoFilter');
        const faseFilter = document.getElementById('faseFilter');

        function populateHeaders() {
            headers.forEach(header =&gt; {
                const th = document.createElement('th');
                th.textContent = header;
                tableHeader.appendChild(th);
            });
        }

        function populateFilters() {
            const empreendimentos = [...new Set(rows.map(row =&gt; row[0]))];
            const fases = [...new Set(rows.map(row =&gt; row[1]))];

            empreendimentos.unshift('Todos');
            fases.unshift('Todas');

            empreendimentos.forEach(emp =&gt; {
                const option = document.createElement('option');
                option.value = emp;
                option.textContent = emp;
                empreendimentoFilter.appendChild(option);
            });

            fases.forEach(fase =&gt; {
                const option = document.createElement('option');
                option.value = fase;
                option.textContent = fase;
                faseFilter.appendChild(option);
            });
        }

        function formatDate(dateString) {
            if (!dateString || dateString === '') return '';
            try {
                const date = new Date(dateString);
                return date.toLocaleDateString('pt-BR', {
                    day: '2-digit',
                    month: '2-digit',
                    year: 'numeric'
                });
            } catch (e) {
                return dateString;
            }
        }

        function formatPhase(phase) {
            if (!phase || phase === '') return '';
            
            const phaseClasses = {
                'ENTREGUE': 'phase-entregue',
                'FINALIZA√á√ÉO': 'phase-finalizacao',
                'SUSTENTA√á√ÉO': 'phase-sustentacao',
                'LAN√áAMENTO': 'phase-lancamento'
            };
            
            const className = phaseClasses[phase] || 'phase-badge';
            return `&lt;span class=&quot;phase-badge ${className}&quot;&gt;${phase}&lt;/span&gt;`;
        }

        function renderTable() {
            const tableBody = document.getElementById('tableBody');
            tableBody.innerHTML = '';
            tableBody.classList.add('loading');
            
            const selectedEmpreendimento = empreendimentoFilter.value;
            const selectedFase = faseFilter.value;

            const filteredRows = rows.filter(row =&gt; {
                const empreendimentoMatch = selectedEmpreendimento === 'Todos' || row[0] === selectedEmpreendimento;
                const faseMatch = selectedFase === 'Todas' || row[1] === selectedFase;
                return empreendimentoMatch &amp;&amp; faseMatch;
            });

            setTimeout(() =&gt; {
                filteredRows.forEach(rowData =&gt; {
                    const tr = document.createElement('tr');
                    tr.classList.add('fade-in');
                    
                    // Adicionar classe especial para linha de total
                    if (rowData[0] === 'Total Geral') {
                        tr.classList.add('total-row');
                    }
                    
                    rowData.forEach((cellData, index) =&gt; {
                        const td = document.createElement('td');
                        
                        // Formata√ß√£o especial por coluna
                        if (index === 1) { // Coluna FASE
                            td.innerHTML = formatPhase(cellData);
                        } else if (index === 2 || index === 3) { // Colunas de data
                            td.innerHTML = formatDate(cellData);
                            td.classList.add('date');
                        } else if (index &gt;= 4 &amp;&amp; index &lt;= 11) { // Colunas num√©ricas
                            td.classList.add('numeric');
                            if (cellData &amp;&amp; !isNaN(cellData) &amp;&amp; cellData !== '') {
                                const num = parseFloat(cellData);
                                if (index === 6 || index === 7 || index === 9 || index === 10) { // Valores monet√°rios
                                    td.textContent = num.toLocaleString('pt-BR', {
                                        style: 'currency',
                                        currency: 'BRL'
                                    });
                                    td.classList.add('currency');
                                } else if (index === 11) { // M¬≤ 
                                    td.textContent = num.toLocaleString('pt-BR', {
                                        minimumFractionDigits: 2,
                                        maximumFractionDigits: 2
                                    }) + ' m¬≤';
                                } else {
                                    td.textContent = num.toLocaleString('pt-BR');
                                }
                            } else {
                                td.textContent = cellData;
                            }
                        } else if (index === 12 || index === 13) { // Percentuais
                            td.classList.add('numeric', 'percentage');
                            if (cellData &amp;&amp; !isNaN(cellData) &amp;&amp; cellData !== '') {
                                const num = parseFloat(cellData) * 100;
                                td.textContent = num.toFixed(2) + '%';
                            } else {
                                td.textContent = cellData;
                            }
                        } else {
                            td.textContent = cellData;
                        }
                        
                        tr.appendChild(td);
                    });
                    tableBody.appendChild(tr);
                });
                
                tableBody.classList.remove('loading');
            }, 150);
        }

        empreendimentoFilter.addEventListener('change', renderTable);
        faseFilter.addEventListener('change', renderTable);

        populateHeaders();
        populateFilters();
        renderTable();

        function updateSummaryCards() {
            const totalAcoes = data.length;
            const totalConcluidas = data.filter(item =&gt; item.Status === 'Concluido').length;
            const totalAndamento = data.filter(item =&gt; item.Status === 'Em Andamento').length;
            const progressoMedio = Math.round((data.reduce((sum, item) =&gt; sum + item['Unnamed: 5'], 0) / totalAcoes) * 100);

            document.getElementById('totalAcoes').textContent = totalAcoes;
            document.getElementById('totalConcluidas').textContent = totalConcluidas;
            document.getElementById('totalAndamento').textContent = totalAndamento;
            document.getElementById('progressoMedio').textContent = progressoMedio + '%';
        }

        function populateTableAndFilters() {
            const tbody = document.querySelector('#dataTable tbody');
            tbody.innerHTML = '';

            const canalFilter = document.getElementById('canalFilter');
            const statusFilter = document.getElementById('statusFilter');

            while (canalFilter.options.length &gt; 1) canalFilter.remove(1);
            while (statusFilter.options.length &gt; 1) statusFilter.remove(1);

            const uniqueCanais = new Set();
            const uniqueStatus = new Set();

            data.forEach(row =&gt; {
                uniqueCanais.add(row.CANAL);
                uniqueStatus.add(row.Status);

                const tr = document.createElement('tr');
                tr.dataset.canal = row.CANAL;
                tr.dataset.status = row.Status;

                const statusClass = row.Status === 'Concluido' ? 'status-concluido' : 'status-andamento';
                const progressoPercent = Math.round(row['Unnamed: 5'] * 100);

                tr.innerHTML = `
                    &lt;td&gt;&lt;strong&gt;${row.CANAL}&lt;/strong&gt;&lt;/td&gt;
                    &lt;td&gt;${row.A√á√ïES}&lt;/td&gt;
                    &lt;td&gt;${row.Motivo}&lt;/td&gt;
                    &lt;td&gt;${row.Meta}&lt;/td&gt;
                    &lt;td&gt;&lt;span class=&quot;${statusClass}&quot;&gt;${row.Status}&lt;/span&gt;&lt;/td&gt;
                    &lt;td&gt;
                        &lt;div class=&quot;progress-container&quot;&gt;
                            &lt;div class=&quot;progress-bar&quot; style=&quot;width: ${progressoPercent}%&quot;&gt;
                                ${progressoPercent}%
                            &lt;/div&gt;
                        &lt;/div&gt;
                    &lt;/td&gt;
                `;
                tbody.appendChild(tr);
            });

            uniqueCanais.forEach(canal =&gt; {
                const option = document.createElement('option');
                option.value = canal;
                option.textContent = canal;
                canalFilter.appendChild(option);
            });

            uniqueStatus.forEach(status =&gt; {
                const option = document.createElement('option');
                option.value = status;
                option.textContent = status;
                statusFilter.appendChild(option);
            });

            updateSummaryCards();
            filterTable();
        }

        function filterTable() {
            const selectedCanal = document.getElementById('canalFilter').value;
            const selectedStatus = document.getElementById('statusFilter').value;
            const rows = document.querySelectorAll('#dataTable tbody tr');

            rows.forEach(row =&gt; {
                const canal = row.dataset.canal;
                const status = row.dataset.status;

                const canalMatch = (selectedCanal === 'all' || canal === selectedCanal);
                const statusMatch = (selectedStatus === 'all' || status === selectedStatus);

                if (canalMatch &amp;&amp; statusMatch) {
                    row.style.display = '';
                } else {
                    row.style.display = 'none';
                }
            });
        }

        document.addEventListener('DOMContentLoaded', function() {
            populateTableAndFilters();
